import { createRouter, createWebHashHistory } from 'vue-router';  // Use createWebHashHistory em vez de createWebHistory
import HomePage from '../views/Home.vue';
import PesquisaPage from '../views/Pesquisa.vue';

const routes = [
    { path: '/', name: 'HomePage', component: HomePage },
    { path: '/pesquisa', name: 'PesquisaPage', component: PesquisaPage },
];

const router = createRouter({
    history: createWebHashHistory(),  // Altere para createWebHashHistory
    routes,
});

export default router;
